INSERT INTO "learnweb_veranst_kommentar" ("veranstid", "kommentar", "sprache") VALUES ('133863', '<p>Im WS2012/2013 wird die Vorlesung "Einf&uuml;hrung in die Wirtschaftsinformatik" als Ringvorlesung angeboten. S&auml;mtliche am Institut f&uuml;r Wirtschaftsinformatik t&auml;tigen Professoren (Professoren Becker,&nbsp;Hellingrath,&nbsp;Klein,&nbsp;Kuchen, M&uuml;ller-Funk, Vossen), Juniorprofessoren (Professoren B&ouml;hme und Stieglitz) sowie Prof. em. Grob und Dr. Reepmeyer werden ihren jeweiligen Themenbereich in einer Veranstaltung vorstellen. Dr. Stein wird gemeinsam mit Frau Malsbender den Rahmen der Veranstaltung gestalten und eine begleitende Fallstudie besprechen.</p>\n<p>Am Ende der Veranstaltung werden die grundlegenden Ans&auml;tze und Ideen der verschiedenen Bereiche in einer 60min&uuml;tigen Klausur abgefragt. Die Veranstaltung wird &uuml;ber das Learnweb begleitet: https://www.uni-muenster.de/LearnWeb/learnweb2/course/view.php?id=6109.</p>', 'de');
INSERT INTO "learnweb_veranst_kommentar" ("veranstid", "kommentar", "sprache") VALUES ('133863', '<p>In the lecture, an overwiew over methods and the economic impact of information science is given from different IS perspectives.</p>', 'en');
INSERT INTO "learnweb_veranst_kommentar" ("veranstid", "kommentar", "sprache") VALUES ('133672', '<p>This course teaches the concepts of Model-driven Software Development (MDSD) and provides necessary theoretical background. MDSD uses models as the main artifact of the development process, from which significant parts of a system are derived automatically. Models do not only serve as documentation, but actually&nbsp;<em>are code</em>. Besides the foundations of MDSD, the lecture deals with Domain-specific Languages (DSLs) as well as model-to-model and model-to-text-transformations.</p>\n<p>A practical course accompanies the lectures. It consists of several assignments to be solved in teams. The assignments apply the concepts from the lecture to practical scenarios.</p>', 'en');
INSERT INTO "learnweb_veranst_kommentar" ("veranstid", "kommentar", "sprache") VALUES ('133672', '<p>This course teaches the concepts of Model-driven Software Development (MDSD) and provides necessary theoretical background. MDSD uses models as the main artifact of the development process, from which significant parts of a system are derived automatically. Models do not only serve as documentation, but actually&nbsp;<em>are code</em>. Besides the foundations of MDSD, the lecture deals with Domain-specific Languages (DSLs) as well as model-to-model and model-to-text-transformations.</p>\n<p>A practical course accompanies the lectures. It consists of several assignments to be solved in teams. The assignments apply the concepts from the lecture to practical scenarios.</p>', 'de');
INSERT INTO "learnweb_veranst_kommentar" ("veranstid", "kommentar", "sprache") VALUES ('133750', 'Die Vorlesung f\1\1hrt in grundlegende Themen des Softwareengineering ein. Behandelt werden u.a.:\nSoftware-Management, Prozessmodelle f\1\1r die Software-Entwicklung (u.a. Wasserfall-Modell, Spiralmodell, Extreme Programming), Planungsphase, Basiskonzepte der Software-Modellierung (u.a. UML), Definitionsphase (OOA), Entwurf (u.a. Entwurfsmuster), Implementierung, Testen, Wiederverwendung.', 'de');
INSERT INTO "learnweb_veranst_kommentar" ("veranstid", "kommentar", "sprache") VALUES ('133750', 'This lecture dicusses the phases planning, definition (incl. UML and OOA), design (incl. design patterns), implementation, and testing of the software-engineering life cycle. Moreover software-development processes are presented. Every 14 days, exercises will be solved, which deepen the understanding of the material explained in the lecture.\n\nThis course is taught in German.', 'en');
