CREATE TABLE "public"."learnweb_eingeschrieben" (
    "mtknr" integer,
    "veranstid" integer,
    "status" character(2),
    "zeitstempel" timestamp without time zone
) WITHOUT OIDS;



CREATE TABLE "public"."learnweb_personal" (
    "pid" integer,
    "zivk" text,
    "nachname" character varying(50),
    "vorname" character varying(50),
    "akadgrad" character varying(50),
    "login" character varying(50)
) WITHOUT OIDS;



CREATE TABLE "public"."learnweb_personal_veranst" (
    "pid" integer,
    "veranstid" integer,
    "sort" integer,
    "zustaendigkeit" character varying(255)
) WITHOUT OIDS;



CREATE TABLE "public"."learnweb_stdp" (
    "mtknr" integer,
    "veranstid" integer,
    "terminid" integer,
    "status" character(2)
) WITHOUT OIDS;


CREATE TABLE "public"."learnweb_ueberschrift" (
    "veranstid" integer,
    "quellid" integer,
    "eid" integer,
    "ueid" integer,
    "semester" integer,
    "untergeord" integer,
    "uebergeord" integer,
    "txt" character varying(255),
    "zeitstempel" timestamp without time zone
) WITHOUT OIDS;



CREATE TABLE "public"."learnweb_veranst_kommentar" (
    "veranstid" integer,
    "kommentar" text,
    "sprache" character(2)
) WITHOUT OIDS;



CREATE TABLE "public"."learnweb_veranstaltung" (
    "veranstid" integer,
    "semester" integer,
    "semestertxt" character(12),
    "urlveranst" text,
    "veranstnr" character(20),
    "titel" character varying(255),
    "veranstaltungsart" character varying(255),
    "zeitstempel" timestamp without time zone,
    "kommentar" character varying(255)
) WITHOUT OIDS;

